import React, {useState} from 'react';
//import styles from  './style.module.scss';
import {Button} from "antd";

export const AreaList = () => {
    const [list, setList] = useState();
    return (
        <div>
            <ul>
                {list.map()}
            </ul>
            <Button type='primary'>新增区块按钮</Button>
        </div>
    )
}
